import React , {useState} from 'react'
import Modal from './Modal';
import './Modal.css'
export default function TeamAdmin() {
    const [show, setShow] = useState(false);
  return (
    <div>
    <div id="popup-background" className='w-full h-full'>
      <div className='w-full h-[10%] bg-white'>
      <button type='button' className='bg-black border-2 flex text-cyan-200 rounded-lg' onClick={()=>{setShow(true)}}>Open Modal</button>
      </div>
        
      <div className='fixed z-100 w-full h-full flex items-center justify-center bg-white'>


<Modal show={show} onClose={()=>{setShow(false)}}/>
</div>
    </div>
    </div>
  )
}
